import React, { useState } from 'react'
import './Forms.css'
import Logo from '../../Assets/tweed-logo-white.svg'
import LogoBlack from '../../Assets/tweed-logo-black.svg'
import GreenCush from '../../Assets/green-cush-quickies.svg'
import {Link} from 'react-router-dom'

/**
* @author
* @function Form
**/

const Form = (props) => {
    const [submission, setSubmission] = useState(false)

    const onSubmission = (e) =>{
        e.preventDefault()

        if(e.target.year.value > 2002){
            window.location.replace('https://gotmilk.com')
        }else{
            setSubmission(true)
            setTimeout(()=>{
                return(
                    <div style={{height: '100vh'}}>
                   <div className='blackLogo'>
                       <img src={LogoBlack} alt='logo_black'></img>
                   </div>
                   <div className='spinning_wheel'>
                       <img src={GreenCush} alt='logo_black'></img>
                   </div>
                   <h2 style={{color: 'black', textAlign: 'center'}}>Quickies are loading</h2>
                   <p id='footer_content' style={{color: 'black', position: 'fixed', bottom: '0'}}>This communication is intended for adults only and should not be shared with minors. There are risks associated with cannabis use. For information, search online “Health Canada - cannabis health effects”.</p>
                    </div>

                )
            }, 2000)
            console.log(e.target.year.value)
        }


    }

// if(submission){
// return(
//     <div style={{height: '100vh'}}>
//    <div className='blackLogo'>
//        <img src={LogoBlack} alt='logo_black'></img>
//    </div>
//    <div className='spinning_wheel'>
//        <img src={GreenCush} alt='logo_black'></img>
//    </div>
//    <h2 style={{color: 'black', textAlign: 'center'}}>Quickies are loading</h2>
//    <p id='footer_content' style={{color: 'black', position: 'fixed', bottom: '0'}}>This communication is intended for adults only and should not be shared with minors. There are risks associated with cannabis use. For information, search online “Health Canada - cannabis health effects”.</p>
